function Navigation()  {  

  return(
	  <nav id="home" className="navbar">
      <ul>
        <li className="logo"><a href="#home">M</a></li>
        <li><a href="#popular">Popular</a></li>
        <li><a href="#top-rated">Top Rated</a></li>
        <li><a href="#upcoming">Upcoming</a></li>
        <li>Search</li>
      </ul>

	  </nav>



  	)	  
}



export default Navigation;
